import { makeStyles } from '@material-ui/core/styles';

export const useStyles = makeStyles((theme) => ({
  root: {
    // paddingTop: '',
  },
  card: {
    marginTop: '2.5%'
  },
  title: {
    textAlign: 'center',
    fontWeight: 'bold',
    fontSize: '40px',
    margin: '20px 0 0 0'
  },
  subtitle: {
    textAlign: 'left',
    paddingLeft: '2.5%'
  }
}));
